  input: '"TEXT","F3A","","On May 8, 2003 we sent a written response to your RQ2 for
    our Year End Report (11/26/02-12/31/02).  In that letter we explained our understanding
    of the questions you had raised about the problems with Columb B figures and contributions
    received after the Primary Election.  On May 19, 2003 we received notice from
    you that you had not received a response to your earlier request for information.  We
    thought our letter of May 8, 2003 was a response.  At this point we called Senior
    Campaign Financie Analyst, Christopher A. Whyrick and asked for guidance.  He
    explained the problems that needed to be corrected.  This electronic filing corrects
    the problems with the Column B figures.  It also shows that all the contirbutions
    in question are for the 2004 Primary Election, not the 2002 Primary Election.  Please
    let us know if you need additional information."'
